import React, { useState } from 'react';
import './App.css'; // Import your CSS file here

function HeartDiseasePrediction() {
    const [inputData, setInputData] = useState({
        age: '',
        sex: '',
        cp: '',
        trestbps: '',
        chol: '',
        fbs: '',
        restecg: '',
        thalach: '',
        exang: '',
        oldpeak: '',
        slope: '',
        ca: '',
        thal: ''
    });

    const [result, setResult] = useState('');

    const handleChange = (e) => {
        setInputData({ ...inputData, [e.target.name]: e.target.value });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        const response = await fetch('http://127.0.0.1:5000/api/predict', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({ input_data: Object.values(inputData).map(Number) }),
        });

        const data = await response.json();
        setResult(data.prediction);
    };

    return (
        <>
            {/* Custom Navbar */}
            <nav>
                <a href="#" className="logo">
                    <svg id="logo-15" width="49" height="48" viewBox="0 0 49 48" fill="none" xmlns="http://www.w3.org/2000/svg">
                        <path d="M24.5 12.75C24.5 18.9632 19.4632 24 13.25 24H2V12.75C2 6.53679 7.03679 1.5 13.25 1.5C19.4632 1.5 24.5 6.53679 24.5 12.75Z" className="ccustom" fill="#17CF97"></path>
                        <path d="M24.5 35.25C24.5 29.0368 29.5368 24 35.75 24H47V35.25C47 41.4632 41.9632 46.5 35.75 46.5C29.5368 46.5 24.5 41.4632 24.5 35.25Z" className="ccustom" fill="#17CF97"></path>
                        <path d="M2 35.25C2 41.4632 7.03679 46.5 13.25 46.5H24.5V35.25C24.5 29.0368 19.4632 24 13.25 24C7.03679 24 2 29.0368 2 35.25Z" className="ccustom" fill="#17CF97"></path>
                        <path d="M47 12.75C47 6.53679 41.9632 1.5 35.75 1.5H24.5V12.75C24.5 18.9632 29.5368 24 35.75 24C41.9632 24 47 18.9632 47 12.75Z" className="ccustom" fill="#17CF97"></path>
                    </svg>
                </a>
                <div className="nav-links">
                    <ul id="navbar">
                        <li><a className="active" href="/getUsers">History HD</a></li>
                        <li><a href="/getUsers">User Details</a></li>
                        <li><a href="/home">Log Out</a></li>
                    </ul>
                </div>
            </nav>

            {/* Heart Disease Prediction Form */}
            <div className="container">
                <h1>Heart Disease Prediction</h1>
                <form onSubmit={handleSubmit}>
                    <input type="text" name="age" placeholder="Age" value={inputData.age} onChange={handleChange} required />
                    <input type="text" name="sex" placeholder="Sex" value={inputData.sex} onChange={handleChange} required />
                    <input type="text" name="cp" placeholder="Chest Pain Type" value={inputData.cp} onChange={handleChange} required />
                    <input type="text" name="trestbps" placeholder="Resting Blood Pressure" value={inputData.trestbps} onChange={handleChange} required />
                    <input type="text" name="chol" placeholder="Cholesterol" value={inputData.chol} onChange={handleChange} required />
                    <input type="text" name="fbs" placeholder="Fasting Blood Sugar" value={inputData.fbs} onChange={handleChange} required />
                    <input type="text" name="restecg" placeholder="Resting ECG" value={inputData.restecg} onChange={handleChange} required />
                    <input type="text" name="thalach" placeholder="Max Heart Rate" value={inputData.thalach} onChange={handleChange} required />
                    <input type="text" name="exang" placeholder="Exercise Induced Angina" value={inputData.exang} onChange={handleChange} required />
                    <input type="text" name="oldpeak" placeholder="ST Depression" value={inputData.oldpeak} onChange={handleChange} required />
                    <input type="text" name="slope" placeholder="Slope" value={inputData.slope} onChange={handleChange} required />
                    <input type="text" name="ca" placeholder="Number of Major Vessels" value={inputData.ca} onChange={handleChange} required />
                    <input type="text" name="thal" placeholder="Thal" value={inputData.thal} onChange={handleChange} required />
                    <button type="submit">Predict</button>
                </form>
                {result && <div className="result">Prediction: {result}</div>}
            </div>
        </>
    );
}

export default HeartDiseasePrediction;
